import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPortal = () => {
  const [pumps, setPumps] = useState([]);
  const [newPump, setNewPump] = useState({ name: '', price: '', link: '' });
  const [image, setImage] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    // Fetch existing pumps
    const fetchPumps = async () => {
      const response = await axios.get('http://localhost:5001/api/pumps');
      setPumps(response.data);
    };
    fetchPumps();
  }, []);

  const handleImageUpload = async (e) => {
    const file = e.target.files[0];
    if (file) {
      const formData = new FormData();
      formData.append('image', file);

      try {
        const response = await axios.post('http://localhost:5001/api/upload', formData);
        setImage(response.data.imageUrl);
      } catch (err) {
        console.error('Error uploading image:', err);
        setError('Error uploading image.');
      }
    }
  };

  const handleAddPump = async () => {
    // Form validation
    if (!newPump.name || !newPump.price || !newPump.link || !image) {
      setError('Please fill all fields and upload an image.');
      return;
    }

    try {
      const pump = { ...newPump, image };
      const response = await axios.post('http://localhost:5001/api/pumps', pump);
      setPumps([...pumps, response.data]);
      setNewPump({ name: '', price: '', link: '' });
      setImage(null);
      setError(''); // Clear any error message on successful submit
    } catch (err) {
      console.error('Error adding pump:', err);
      setError('Error adding pump.');
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Admin Portal</h1>

      {/* Display error message if validation fails */}
      {error && <div style={{ color: 'red', marginBottom: '10px' }}>{error}</div>}

      {/* Add New Pump Form */}
      <div>
        <h2>Add New Pump</h2>
        <div>
          <input
            type="text"
            placeholder="Name"
            value={newPump.name}
            onChange={(e) => setNewPump({ ...newPump, name: e.target.value })}
            style={{ padding: '8px', marginBottom: '10px', width: '100%' }}
          />
        </div>
        <div>
          <input
            type="text"
            placeholder="Price"
            value={newPump.price}
            onChange={(e) => setNewPump({ ...newPump, price: e.target.value })}
            style={{ padding: '8px', marginBottom: '10px', width: '100%' }}
          />
        </div>
        <div>
          <input
            type="text"
            placeholder="Link"
            value={newPump.link}
            onChange={(e) => setNewPump({ ...newPump, link: e.target.value })}
            style={{ padding: '8px', marginBottom: '10px', width: '100%' }}
          />
        </div>
        <div>
          <input
            type="file"
            onChange={handleImageUpload}
            style={{ marginBottom: '10px' }}
          />
        </div>
        <button
          onClick={handleAddPump}
          style={{ padding: '10px 20px', backgroundColor: 'blue', color: 'white', border: 'none' }}
        >
          Add Pump
        </button>
      </div>

      {/* Existing Pumps */}
      <div style={{ marginTop: '40px' }}>
        <h2>Existing Pumps</h2>
        {pumps.map((pump) => (
          <div key={pump._id} style={{ marginBottom: '20px' }}>
            <img
              src={`http://localhost:5001${pump.image}`}
              alt={pump.name}
              width="100"
              style={{ marginRight: '20px' }}
            />
            <p>{pump.name}</p>
            <p>{pump.price}</p>
            <p>{pump.link}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdminPortal;
